import React from 'react';
import intro from '../css/intro.css';

class Intro extends React.Component {




  render() {
    return(
      <section style={{height: "100%"}}>
        <div className="background-image">
          <div className="options-container">
            <div className="truck-owner box">
              <p>
                G12 Transport is a privately owned trucking company based in Los Angeles.
                Our company is composed of owner-operators: self-employed commercial truck drivers that operate trucks for transporting goods over highways for its customers.
                If you are interested in applying as an owner-operator, click here:
              </p>
              <div className="apply-button">
                <button> Apply </button>
              </div>
            </div>
          </div>
        </div>
      </section>
    );
  }
}

export default Intro;
